module CLex
# 1 "CLex.fsl"
 
 (* File MicroC/CLex.lex
    Lexer specification for micro-C, a small imperative language
  *)
// 这是一个微型C语言（micro-C）的词法分析器，用于将源代码转换为一系列令牌（tokens），以供后续的语法分析使用。
// 词法分析器读取源代码，将其分解为单个单元，称为词法单元（lexeme），并将它们映射到语言的单词或标记（token）。
// 每个规则都代表一个词法单元或标记，例如加号、减号、乘号、除号等。

// 其中，对于关键字和标识符的处理，首先会将关键字列在一个函数中，根据输入字符串与其进行匹配，如果匹配成功，
// 则返回对应的Token；如果没有匹配成功，则认为其为标识符，返回Token NAME。对于字符串转义符的处理，
// 使用辅助函数cEscape进行匹配及转换。

// 此外，还包含多行注释、单行注释的处理规则，从而实现了可以过滤注释内容的词法分析。同时，对于字符串的处理，
// 需要注意转义字符、文件结束、不合法字符等情况，以确保提取正确的字符串。
// module CLex = 
  
open FSharp.Text.Lexing
open CPar  // Token 的定义位于语法分析模块中

// 辅助函数，从lexbuf 得到当前的 词元字符串，lexeme 
let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

(* Scan keywords as identifiers and use this function to distinguish them. *)
(* If the set of keywords is large, use a hashtable instead.               *)
// keyword 处理关键字与标识符的辅助函数
let keyword s =   
    match s with
    | "char"    -> CHAR    // 返回对应的Token ,Token 定义于 CPar.fsl 文件中
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "if"      -> IF
    | "int"     -> INT
    | "null"    -> NULL
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID 
    | "while"   -> WHILE
    | "for"     -> FOR  
    | "switch"  -> SWITCH       
    | "case"    -> CASE
    | "break"   -> BREAK
    | _         -> NAME s   // 缺省情况，是标识符的名字，如 函数名，变量名等
                            // 当所有的关键字没有匹配成功时，则当成标识符
// 字符串转义符处理函数
let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

